webpackJsonp([83674047970715],{1106:function(e,t){e.exports={data:{markdownRemark:{html:"<p>Three videos for your Sunday afternoon enjoyment. (The first two are for the hippies, the last one is for the geeks.)</p>\n<h3>The Corporation</h3>\n<p>\"Among the 40 interview subjects are CEOs and top-level executives from a range of industries: oil, pharmaceutical, computer, tire, manufacturing, public relations, branding, advertising and undercover marketing; in addition, a Nobel-prize winning economist, the first management guru, a corporate spy, and a range of academics, critics, historians and thinkers are also interviewed.\" <span class=\"attribution\"><a href=\"ttp://www.thecorporation.com\">The Corporation</a></span></p>\n<p>[http://video.google.com/googleplayer.swf?docId=-3969792790081230711&#x26;hl=en]</p>\n<h3> The Story of Stuff </h3>\n\"The Story of Stuff is a 20-minute, fast-paced, fact-filled look at the underside of our production and consumption patterns.\"\n<img src='/static/images/picture-4.jpg' alt='The story of stuff' />\n<h3>Rspec User Stories</h3>\n<p>\"The implementation of RSpec stories also fills a gap once filled by Railsâ€™ integration tests. RSpec stories run against the whole stack of your application, including routes, controllers, models, and views.This 50-minute screencast introduces stories and shows you how to use them with pure Ruby code or inside a Rails application.\" [This one ain't free! But totally worth it. -ed.]</p>\n<img src='/static/images/cover-1.jpg' alt='rspec' />\n<img src='/static/images/code.jpg' alt='rspec user stories screenshot' />",frontmatter:{created_at:"February 10, 2008",path:"/2008/02/10/sunday-afternoon-telly",title:"Sunday Afternoon Telly",tags:["video"]}}},pathContext:{}}}});
